import React, { Component } from 'react';
import './TodoItem.css'
class TodoItem extends Component {
    render() {
        let className = "TodoItem";
        if(this.props.item.isCompleted == true) {
            className += " completed";
        }
        return (
            <div className={className}>
                <p>{this.props.item.title}</p>
            </div>
        );        
    }
}

export default TodoItem;
